# Instructions
"""
Given a non-empty string s, you may delete at most one character. Judge whether you can make it a palindrome.

Example 1:
Input: "aba"
Output: True

Example 2:
Input: "abca"
Output: True

Explanation: You could delete the character 'c'.
Note:
The string will only contain lowercase characters a-z. The maximum length of the string is 50000.
"""

from collections import defaultdict
test_no = 1
class Solution:
    # def validPalindrome_PRACTICE(self, s):
    def validPalindrome(self, s):
        def helper(s, i, j):
            _len = len(s)
            k = i
            while k <= (_len // 2):
                if s[k] != s[j-k+i]:
                    return False
                k += 1
            return True

        _len = len(s)
        i = 0
        while i <= (_len // 2):
            if s[i] != s[-1 - i]:
                j = _len-1-i
                return helper(s, i+1, j) or helper(s, i, j-1)
            i += 1
        return True


    def validPalindrome_PASSED(self, s):
    # def validPalindrome(self, s):
        """
        :type s: str
        :rtype: bool
        """
        _len = len(s)
        i = 0
        while i <= (_len // 2):
            if s[i] != s[-1 - i]:
                j = _len - 1 - i
                return self.helper2(s, i + 1, j) or self.helper2(s, i, j - 1)
            i += 1
        return True

    def helper2(self, s, i, j):
        _len = len(s)
        k = i
        while k <= (_len // 2):
            if s[k] != s[j-k+i]:
                return False
            k += 1
        return True

def test(sol, retval):
    global test_no
    print("{}. ".format(test_no), end="")
    test_no += 1
    if retval != sol:
        print("FAIL", end=" ")
    else:
        print("OK", end=" ")
    print(" - sol: {},  ret: {}".format(sol, retval))


def main():
    test(True, Solution().validPalindrome("aba"))        # True
    test(True, Solution().validPalindrome("abca"))       # True
    test(True, Solution().validPalindrome("deeee"))      # True
    test(False, Solution().validPalindrome("abc"))        # False
    test(False, Solution().validPalindrome("abcafazba"))  # False
    test(True, Solution().validPalindrome("cbbcc"))      # True
    test(True, Solution().validPalindrome("enbbe"))      # True
    test(False, Solution().validPalindrome("")) # False





